import { useState } from "react";
import pflText from "../Assets/text.png";

export default function Match() {
  const [homeClub, setHomeClub] = useState("");
  const [homeClubGoals, setHomeClubGoals] = useState(null);
  const [awayClub, setAwayClub] = useState("");
  const [awayClubGoals, setAwayClubGoals] = useState(null);

  const handleSubmit = (event) => {
    event.preventDefault();

    // Create a new match object with the entered data
    const newMatch = {
      homeClub,
      homeClubGoals: Number(homeClubGoals),
      awayClub,
      awayClubGoals: Number(awayClubGoals),
    };

    // Retrieve existing data from localStorage or initialize an empty array
    const existingData = JSON.parse(localStorage.getItem("testData")) || [];

    // Update the testData array by adding the new match
    const updatedTestData = [...existingData, newMatch];

    // Store the updated testData in localStorage
    localStorage.setItem("testData", JSON.stringify(updatedTestData));

    // Clear the form fields
    setHomeClub("");
    setHomeClubGoals(null);
    setAwayClub("");
    setAwayClubGoals(null);

    alert(
      `${homeClub} scored ${homeClubGoals} goals and ${awayClub} scored ${awayClubGoals} goals`
    );
  };

  const handleHomeOption = (event) => {
    setHomeClub(event.target.value);
  };

  const handleAwayOption = (event) => {
    setAwayClub(event.target.value);
  };

  const isDisabled =
    homeClubGoals === null ||
    awayClubGoals === null ||
    homeClub === "" ||
    homeClub === awayClub;

  return (
    <div>
      <img
        src={pflText}
        alt="Logo"
        style={{
          display: "block",
          margin: "auto",
          width: "300px",
          marginTop: "90px",
        }}
      />
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <h1
          style={{
            marginTop: "40px",
            backgroundColor: "#138ce8",
            width: "300px",
            textAlign: "center",
            height: "70px",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          Add Match
        </h1>
      </div>
      <div className="addMatchBox">
        <div className="matchBox">
          <form onSubmit={handleSubmit}>
            <div className="addMatch">
              <select
                style={{ marginLeft: "-15px" }}
                value={homeClub}
                onChange={handleHomeOption}
              >
                <option value="">Choose Home Club</option>
                <option value="Akela">Akela</option>
                <option value="Ceros">Ceros</option>
                <option value="Grizzly">Grizzly</option>
                <option value="Hydra">Hydra</option>
                <option value="Raptors">Raptors</option>
                <option value="Stags">Stags</option>
                <option value="Tusker">Tusker</option>
                <option value="Valiente">Valiente</option>
              </select>
              <i></i>
            </div>
            <div className="addMatch">
              <input
                type="number"
                required="required"
                value={homeClubGoals}
                onChange={(e) => setHomeClubGoals(e.target.value)}
              />
              <span>Goals</span>
              <i></i>
            </div>
            <h1>VS</h1>
            <div className="addMatch" style={{ marginTop: "-10px" }}>
              <select
                style={{ marginLeft: "-15px" }}
                value={awayClub}
                onChange={handleAwayOption}
              >
                <option value="">Choose Away Club</option>
                <option value="Akela">Akela</option>
                <option value="Ceros">Ceros</option>
                <option value="Grizzly">Grizzly</option>
                <option value="Hydra">Hydra</option>
                <option value="Raptors">Raptors</option>
                <option value="Stags">Stags</option>
                <option value="Tusker">Tusker</option>
                <option value="Valiente">Valiente</option>
              </select>
              <i></i>
            </div>
            <div className="addMatch">
              <input
                type="number"
                required="required"
                value={awayClubGoals}
                onChange={(e) => setAwayClubGoals(e.target.value)}
              />
              <span>Goals</span>
              <i></i>
            </div>
            <input type="submit" value="Add Match" disabled={isDisabled} />
          </form>
        </div>
      </div>
    </div>
  );
}
